var bezier={factorial:function(b){var a=this;return b>1?b*a.factorial(b-1):1},point2D:function(a,b){return{x:a,y:b}},bezier_1:function(b,d,c){var a=1-b;return this.point2D(Math.round(a*d.x+b*c.x),Math.round(a*d.y+b*c.y))},bezier_2:function(d,g,f,e){var b=1-d,c=b*b,a=d*d;return this.point2D(Math.round(c*g.x+2*b*f.x+a*e.x),Math.round(c*g.y+2*b*f.y+a*e.y))},bezier_3:function(h,g,f,e,d){var b=this;var i=1-h,a=i*i*i,c=h*h*h;return b.point2D(Math.round(a*g.x+3*h*i*i*f.x+3*h*h*i*e.x+c*d.x),Math.round(a*g.y+3*h*i*i*f.y+3*h*h*i*e.y+c*d.y))},bezier_4:function(i,h,g,f,e,d){var b=this;var j=1-i,a=j*j*j*j,c=i*i*i*i;return b.point2D(Math.round(a*h.x+4*i*j*j*j*g.x+6*i*i*j*j*f.x+4*i*i*i*j*e.x+c*d.x),Math.round(a*h.y+4*i*j*j*j*g.y+6*i*i*j*j*f.y+4*i*i*i*j*e.y+c*d.y))},bezier_5:function(k,j,h,g,f,e,d){var b=this;var i=1-k,a=i*i*i*i*i,c=k*k*k*k*k;return b.point2D(Math.round(a*j.x+5*k*i*i*i*i*h.x+10*k*k*i*i*i*g.x+10*k*k*k*i*i*f.x+5*k*k*k*k*i*e.x+c*d.x),Math.round(a*j.y+5*k*i*i*i*i*h.y+10*k*k*i*i*i*g.y+10*k*k*k*i*i*f.y+5*k*k*k*k*i*e.y+c*d.y))},bezier_n:function(c,p){var k=this;var o=[];for(var f=2;f<=2+c;f++){var r=arguments[f];o.push(r)}if(o.length==c+1){var q=1-p,l=Math.pow(q,c),b=Math.pow(p,c);var a=[];for(var d=0;d<=c;d++){a[d]=k.factorial(c)/k.factorial(d)/k.factorial(c-d)}var h=0,g=0;for(var e=0;e<=c;e++){var r=o[e];if(e==0){h+=a[0]*l*r.x;g+=a[0]*l*r.y}else{if(e==c){h+=a[c]*b*r.x;g+=a[c]*b*r.y}else{h+=a[e]*Math.pow(p,e)*Math.pow(q,c-e)*r.x;g+=a[e]*Math.pow(p,e)*Math.pow(q,c-e)*r.y}}}if(h&&g){return k.point2D(Math.round(h),Math.round(g))}}else{return new Error("arguments error!")}},};